package com.yskj.models;import com.fasterxml.jackson.annotation.JsonFormat;import com.yskj.aop.StorageChild;import lombok.Data;import java.util.Date;//表名称 interview@Datapublic class Interview extends BaseEntity {	private static final long serialVersionUID = 1L;	public Interview() {		super();	}	    //地点(关联地址信息表)    private String interviewAddress;    //说明    private String instructions;    //时间    @JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss")    private Date interTime;    //发布职位模版表主键（关联Position 表 主键）    private String positionID;    //培训或面试 1 面试 2 培训    private Integer isCultivate;    @StorageChild(service = "localtioninfoService",refColumn = "interviewAddress")    private Localtioninfo localtioninfo;}